import { observer } from 'mobx-react-lite';
import React, { useState } from 'react';

const TypeBar = observer(() => {
    const [carTypes, setCarTypes] = useState(false)
    const {device} = useCon

    return (
        <div className='d-flex'>
            <div class="dropdown">
                <button onClick={()=>setCarTypes(!carTypes)} class="btn btn-secondary dropdown-toggle" type="button" >
                    Dropdown button
                </button>
                {carTypes ? 
                (device.types.map(type =><div className ="dropup-menu">
                <div className='d-flex align-items-center'>
                    <input type='checkbox' class="mt-1"/>
                    <p className='m-0 ms-1 fs-7'>geriui</p>
                </div>
            </div>) )
                : 
                <ul className = "dropdown-menu"></ul>
                }
            </div>
        </div>
    );
});

export default TypeBar;
